import pokemons from "./pokemon.json";

import bg3 from './assets/bg3.jpeg';

const App = () => {
  return (
    <>
    <Header 
    title = 'This is title' 
    descr='This is Description!'/>

    <Layout 
    title = 'This is _1' 
    descr='This is Description!'
    urlBg = {bg3}
    colorBg = "#00bfff" />

        <p>
          In the game two players face off against one another, one side playing
